import React, {Component} from 'react'
Component = React.Component;
class Menu extends Component{
    state={
        text:"state text"
    };
    render(){
        return <div>
                    <button onClick={()=>this.setState(this.state.text)}>Btn1</button>
                    <button>Btn2</button>
                    <br></br>
                    {this.state.text}
        </div>;
    }
}

export default Menu;
